import React from "react";
import { Table } from "react-bootstrap";
import ListItem from "./ListItem";

export default function ListPage() {
  return (
    <div>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>#</th>
            <th>University Name</th>
            <th>Domain</th>
            <th>Web Page</th>
          </tr>
        </thead>
        <tbody>
       <ListItem></ListItem>
          
        </tbody>
      </Table>
    </div>
  );
}
